import React, { useState } from "react";

import Box from './box'
import './App.css'

function App() {
    const [box1Checked, setBox1] = useState(false);
    const [box2Checked, setBox2] = useState(false);
    const [box3Checked, setBox3] = useState(false);
    const [box4Checked, setBox4] = useState(false);
    let count = 0;
    count = box1Checked + box2Checked + box3Checked + box4Checked;
    return (
        <div>
            <h1>Count: {count}</h1>
            <div class = "grid">
                <Box onBoxCheck = {(box1) => setBox1(box1)}/>
                <Box onBoxCheck = {(box2) => setBox2(box2)}/>
                <Box onBoxCheck = {(box3) => setBox3(box3)}/>
                <Box onBoxCheck = {(box4) => setBox4(box4)}/>
            </div>
        </div>
    );
}

export default App;
